import styled from "styled-components";

export const Container = styled.div`
    h1 {
        color: var(--white);
        font-weight: 500;
    }

    p {
        color: var(--light-gray);
        font-weight: 400;
    }

    .acoes {
        background: var(--gray-background);
    }
`
